CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateAssignAndFileInfo`(IN sequenceText VARCHAR(255), IN lastFileName VARCHAR(255))
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE assignVal, seqElement VARCHAR(255);
    DECLARE counter, sno, sequenceLength INT DEFAULT 0;
    DECLARE id INT;
    DECLARE cur CURSOR FOR SELECT id FROM assign WHERE filename = lastFileName;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    SET @sequence = sequenceText;
    SET @sequenceArray = REPLACE(@sequence, ',', ' ');
    SET sequenceLength = (LENGTH(@sequenceArray) - LENGTH(REPLACE(@sequenceArray, ' ', ''))) + 1;

